DROP TABLE IF EXISTS `request`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `request` (
  `request_id` int NOT NULL AUTO_INCREMENT,
  `affiliation_name` varchar(100) NOT NULL DEFAULT 'none' COMMENT 'The university or company you are affiliated with',
  `affiliation_description` varchar(45) DEFAULT 'none' COMMENT 'A short description of your university or company',
  `affiliation_email` varchar(45) DEFAULT 'none' COMMENT 'contact email for your university or company',
  `affiliation_phone_number` varchar(45) DEFAULT 'none' COMMENT 'contact number for the university or company',
  `total_hours` decimal(10,2) DEFAULT NULL COMMENT 'The expected total hours of your test',
  `shift` varchar(25) DEFAULT '1' COMMENT 'Request shifts',
  `facility_id` varchar(4) DEFAULT NULL,
  `user_id` int NOT NULL,
  `earliest_date` datetime DEFAULT NULL COMMENT 'The start date you would like for your test',
  `approved` tinyint(1) DEFAULT NULL,
  `retracted` tinyint(1) DEFAULT '0',
  `time_used` tinyint(1) DEFAULT '0',
  `purpose_of_test` varchar(500) DEFAULT NULL COMMENT 'A short name or description for your test',
  `description` varchar(2500) DEFAULT NULL COMMENT 'A longer explanation and any special scheduling requests for your test such as days to avoid',
  `energy_level` varchar(25) DEFAULT NULL,
  `vacuum` tinyint(1) DEFAULT '0',
  `public` tinyint(1) DEFAULT '0',
  `requester_name` varchar(60) DEFAULT NULL COMMENT 'Name of person requesting time',
  `priority_one` varchar(60) DEFAULT NULL COMMENT 'Non rated',
  `flux` decimal(10,2) DEFAULT NULL COMMENT 'Enter desired flux',
  PRIMARY KEY (`request_id`),
  KEY `request_FK` (`user_id`),
  KEY `request_FK_1` (`facility_id`)
) ENGINE=InnoDB AUTO_INCREMENT=615 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
